
LOCALS


.model large
	
	PUBLIC _Cog3D_Move
	global _tile_tempdata
	global cog3d_lines


.code

	align   2

_Cog3D_Move proc	far
ARG   frame:word
LOCAL _offset:word
	push bp
	mov  bp, sp         ; caller's stack frame
	;DRAW FAST LINES
	;SET ADDRESS

	push ds
	push di
	push si
	
	mov dx,003c4h
	mov ax,0F02h
	out dx,ax 		;write all the bitplanes.
	mov dx,003ceh
	mov ax,008h		
	out dx,ax
	
	mov 	ax,0A000h
	mov 	ds,ax
	mov		si,0BFF0h				;ds:si TILE_VRAM address;
	add		si,32*64

	mov 	ax,0A000h
	mov 	es,ax
	mov		di,(84*284)+28			;es:di VRAM screen address
	
	mov		bx,frame				;offset frame*200
	mov		ax,66					;132/2
	mov		ch,0

	loop_line:
		mov si,cog3d_lines[bx]
		mov cl,20	;80 pixels
		rep movsb	;COPY a line ds:si -> es:di
		add di,64	;goto next line
		mov si,cog3d_lines[bx+2]
		mov cl,20
		rep movsb	;COPY a line ds:si -> es:di
		add di,64	;goto next line
		add bx,4
		dec ax
		jnz loop_line
	
	mov dx,003cfh
	mov ax,00ffh		
	out dx,ax
	
	pop si
	pop di
	pop ds
	mov sp, bp
	pop bp

	ret
	
_Cog3D_Move endp


